        <div className="slider">
            <img src="images/hotel-1.jpg" alt="" className="slider-img"/>
            <img src="images/hotel-2.jpg" alt="" className="slider-img"/>
            <img src="images/hotel-3.jpg" alt="" className="slider-img"/>
        </div>
    );
};

export default Slider;
